exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.doupobook.cc/${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/id="play[^>]+>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};